import React from 'react'
import styles from './ModalLogin.module.css';
import { googleLogin, githubLogin,naverLogin } from '../../api/firebase';

function ModalLogin({setModalOpen}) {
  const closeModal = () => {
    setModalOpen(false);
  };
  return (
    <div className={styles.modal}>
      <button className={styles.close} onClick={closeModal}>
                X
            </button>
            <button className={styles.google} onClick={()=>{googleLogin(); closeModal();}}>google</button>
            <button className={styles.github} onClick={()=>{githubLogin(); closeModal();}}>github</button>
            <button className={styles.naver} onClick={console.log("아직 구현 안했어")}>github</button>
    </div>
  );
}

export default ModalLogin
